import React from 'react'
import { Link } from 'react-router-dom'

const ShowList = ({items}) => {
  return (
    <div>
    <ul>
      {items.map((item) => (
        <li key={item.id}>
          <article >
            <h2><Link>{item.title}</Link></h2>
            <ol>
              <ol>
                overview: {item.overview?<span>{item.overview}</span>:<span></span>}
              </ol>
            </ol>
          </article>
        </li>
      ))}
    </ul>
  </div>
  )
}

export default ShowList
